            script = script.Remove(script.Length - 3, 1);
            script.AppendLine("];");

            script.AppendLine("var mun = null;");
            script.AppendLine("mun = new google.maps.Polygon({");
            script.AppendLine("paths: munCoordinates,");
            script.AppendLine("strokeColor: \"#000000\",");
            script.AppendLine("strokeOpacity: 0.8,");
            script.AppendLine("strokeWeight: 2,");
            script.AppendLine("fillColor: \"#FF0000\",");
            script.AppendLine("fillOpacity: 0.2");
            script.AppendLine("});");

            script.AppendLine("mun.setMap(map);");           

            return script.ToString();
        }

        String getIcon(ETipoUnidade e)
        {
            switch (e)
            {
                case ETipoUnidade.Privada:
                case ETipoUnidade.Publica: return "http://www.desenvolvimentosocial.sp.gov.br/mapa/img/icon_entidades.png";
                case ETipoUnidade.CRAS: return "http://www.desenvolvimentosocial.sp.gov.br/mapa/img/icon_cras.png";
                case ETipoUnidade.CREAS:
                case ETipoUnidade.CentroPOP: return "http://www.desenvolvimentosocial.sp.gov.br/mapa/img/icon_creas.png";
            }
            return "";
        }
    }
